import React, { useState } from 'react';
import './test.css';

const TestPage = () => {
  const [showDetails, setShowDetails] = useState(false);

  const handleNextClick = () => {
    setShowDetails(true);
  };

  const handleBackClick = () => {
    setShowDetails(false);
  };
  return (
    <div id='page-layout'>
      <div id='navbar'>Navbar</div>
      <h1 id='page-title'>Create New Template</h1>
      <form>
        <div>
          <div id='input-container'>
            <input
              type='text'
              id='full-width-input'
              placeholder='Enter Workname Name'
            />
          </div>

          <div id='template-detail-container'>
            <div id='template-detail'>
              <select id='difficulty-level'>
                <option value=''>Select Difficulty Level</option>
              </select>
            </div>
          </div>
        </div>

        <div id='slide-container'>
          <div
            className='exercise-container'
            style={{
              transform: showDetails ? 'translateX(-100%)' : 'translateX(0)'
            }}
          >
            <div id='exercises'>Exercises</div>
          </div>
          <div
            className='template-details'
            style={{
              transform: showDetails ? 'translateX(0)' : 'translateX(100%)'
            }}
          >
            Details go here...
            <p>some stuff to see if the alignment changes</p>
          </div>
        </div>
        <div className='button-container'>
          <button id='save-template-button'>Save Template</button>
        </div>
      </form>
    </div>
  );
};

export default TestPage;
